class Inventory extends React.Component {
    fetchProducts = async () => {
        const response = await fetch("/api/v1/inventory", {
          method: "GET",
          headers: {
            "Content-Type": "application/json"
          }
        })
          .then(response => {
            return response.json();
          })
          .then(products => {
            this.setState({ productsArray: products.data });
          });
      }






